@FashionNova  and #MeganTheeStallion has teamed up with #Lala to present today’s $25,000 recipient to #GirlsIncNYC 🌟 

Entirely women-led, Girls Inc. of New York City is a non-profit that partners with schools, community-based organizations, as well as individual girls and their families to provide an empowering experience

Head over to @FashionNovaCARES  to learn more about their new female empowerment initiative called Women On Top ‼️
